export default function App() {

  return (

    <View style={styles.container}>
      <View style={styles.header}>
       <FontAwesome 
          name='home'
          size={45}
          color='#00FFFF'
        />
        <FontAwesome 
          name='bati'
          size={45}
          color='#00FFFF'
        />
         <FontAwesome 
          name='bati'
          size={45}
          color='#00FFFF'
        />
         <Text style={{color:'#ff0000'}} >
        Header</Text>

      </View>

      <View style={styles.feed}>
        <Text style={{color:'#ff0000'}}>Feed</Text>
      </View>

      <View style={styles.footer}>
        <Text style={{color:'#ff0000'}}>Footer</Text>
      </View>

      <StatusBar style='auto' />
    </View>

  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#364ff2',
